import './App.css'; 
import {BrowserRouter,Switch,Router} from "react-router-dom"
import MyApp from "./Containers/MyApp"
function App() {
  return (
    <BrowserRouter>
      <Switch>
          <Route exact path="/" component={()=><HomePage/>}/>
      </Switch>
    </BrowserRouter>
  );
}
export default App;
